import BookShow from './BookShow';
function BookList({ books }) {

    const renderBooks = books.map((book) => {
        return (
            <div >

                <BookShow key={book.id} title={book.title} />

            </div>
        );
    });
    return (
        <div>
            <h1>BookList</h1>
        </div>
    );
}

export default BookList;
